import React from 'react';
import logo from '../dog.svg';

function Header () {
  return (
    <header className="App-header">
      <div className="columns">
        <div className="column">
          <img src={logo} className="App-logo" alt="logo" />
        </div>
        <div className="column">
          <p style={{marginTop: 50, marginBottom: 50}}>
            Doggo Fair Registration Console
          </p>
		  <p>
		  Create, Read, Update and Delete these registrations
		  </p>
          <button className="button is-primary">Register new doggo</button>
        </div>
      </div>
    </header>
  );
}

export default Header;
